  false,\n\t\"url\": null,\n\t\"notes\": \"Vector datasets of CWHR range maps are
  one component of California Wildlife Habitat Relationships (CWHR), a comprehensive
  information system and predictive model for California's wildlife. The CWHR System
  was developed to support habitat conservation and management, land use planning,
  impact assessment, education, and research involving terrestrial vertebrates in
  California. CWHR contains information on life history, management status, geographic
  distribution, and habitat relationships for 694 species of amphibians, reptiles,
  birds, and mammals known to occur regularly in the state. Range maps represent the
  maximum, current geographic extent of each species within California. They were
  originally delineated at a scale of 1:5,000,000 by species-level experts and have
  gradually been revised at a scale of 1:1,000,000.\",\n\t\"license_title\": null,\n\t\"extras\":
